import React from "react";
import axios from "axios";
import Swal from "sweetalert2";

// Imposta una funzione per gestire la risposta dal server
const handleResponse = (response) => {
  if (response.success) {
    // Mostra un popup con un messaggio di successo
    Swal.fire({
      title: 'Mail inviata',
      text: response.message,
      icon: 'success',
      showCloseButton: true,
    });
  } else {
    // Mostra un popup con un messaggio di errore
    Swal.fire({
      title: 'Errore',
      text: response.message,
      icon: 'error',
      showCloseButton: true,
    });
  }
};

// Ascolta la risposta dal server
axios.post(`${window.location.origin}/contatti/risposta`, {}).then(handleResponse);

function Contact(){
    return(
      <section id="contact" class="contact">
      <div class="container" data-aos="fade-up">

        <div class="section-title">
          <h2>Contatti</h2>
        </div>

        <div class="row mt-1">

          <div class="col-lg-4">
            <div class="info">
              <div class="address">
                <i class="bi bi-geo-alt"></i>
                <h4>Lavoro a:</h4>
                <p>Ferrara, Bologna, Comacchio, Ravenna e Rovigo.</p>
              </div>

              <div class="email">
                <i class="bi bi-envelope"></i>
                <h4>Email:</h4>
                <p>elena@artisticamenteonline.it</p>
              </div>

              <div class="phone">
                <i class="bi bi-phone"></i>
                <h4>Cell:</h4>
                <p>3519368237</p>
              </div>

            </div>

          </div>

          <div class="col-lg-8 mt-5 mt-lg-0">

            <form id="contact-form" action="http://localhost:5050/contatti " method="post" role="form" class="php-email-form">
              <div class="row">
                <div class="col-md-6 form-group">
                  <input type="text" name="nome" class="form-control" id="nome" placeholder="Nome" required/>
                </div>
                <div class="col-md-6 form-group mt-3 mt-md-0">
                  <input type="email" class="form-control" name="email" id="email" placeholder="Email" required/>
                </div>
              </div>
              <div class="form-group mt-3">
                <input type="text" class="form-control" name="subject" id="subject" placeholder="Oggetto" required/>
              </div>
              <div class="form-group mt-3">
                <textarea class="form-control" name="messaggio" id="messaggio" rows="5" placeholder="Messaggio" required></textarea>
              </div>
              <div class="my-3">
                {/* <div class="loading">Loading</div>
                <div class="error-message"></div> */}
                <div id =" message"></div>
              </div>
              <div class="text-center"><button type="submit">Invia messaggio</button></div>
            </form>

          </div>

        </div>

      </div>
    </section>  
    );
}
export default Contact;
